let t1 = new Date();
function findCommonUsingFor(array1, array2) {
    let common = [];
    for (let i = 0; i < array1.length; i++) {
        for (j = 0; j < array2.length; j++) {
            if (array1[i] === array2[j]) {
                common.push(array2[j]);
            }
        }
    }
    return common;
}

