// Using while loop, break if one of them is runs out 
let tt1 = new Date();

function findCommonUsingWhile(array1, array2) {
    array1.sort((a, b) => a - b);
    array2.sort((a, b) => a - b);
    let cm = [];
    let i = 0, j = 0;
    while (i < array1.length && j < array2.length) {
        if (array1[i] === array2[j]) {
            cm.push(array1[i]);
            i++; j++;
        } else if (array1[i] < array2[j]) {
            i++;
        } else {
            j++;
        }
    }
    return cm;
}

